import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {Login } from './general/Login';

function App() {
  return (
    <>
    <Router>
      <Link to="/home">Login</Link>
      <Routes>
      <Route exact path="/home" element={<Login/>} />
      </Routes>
    </Router>
    </>
  );
}
export default App;
